using Cosmos.System.Graphics;
using System;

namespace Aura_OS.System
{
    public class Logo
    {

        /// <summary>
        /// Display Logo of Aura
        /// </summary>
        public static void Print()
        {

            Console.Clear();

            Console.ForegroundColor = ConsoleColor.White;
            Console.WriteLine($@"
  
 
 
  
              Uszka Operating System
              v{ Uszka.Kernel.version }
");
            Bitmap bitmap = new Bitmap(Convert.FromBase64String(b64logo));
            Uszka.Kernel.AConsole.DrawImage(17, 6, bitmap);
        }

        private static string b64logo = "";

    }
}
